import React, { useEffect, useReducer, useState } from 'react';
import { connect } from 'react-redux';
import { showMyLearningToolTip } from '../src/store/reduxTest/ReduxTestActions';
import './App.css';
import { useSelector, useDispatch } from 'react-redux';
import  reducer  from '../src/store/reducer';
import axios from 'axios';
import { Routes, Route } from 'react-router-dom'

const App = props => {

  return (
      <div>
      <Routes>
            <Route path="/" component={() => <div>Home</div>}/>
           <Route path="/kishore" component={() => <div>Hello Kihsore</div>}/>
      </Routes>
        </div>
  );
}


const mapStateToProps = state => ({
  showMyLearningTooltip : state.showMyLearningTooltip
});

const mapDispatchToProps = dispatch => ({
  showMyLearningToolTip: value => dispatch(showMyLearningToolTip(value))
});

export default connect(mapStateToProps, mapDispatchToProps)(App);
